import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import {Nav, Table, TextForm, TranslationPage, DataPage} from './App';
import * as serviceWorker from './serviceWorker';
ReactDOM.render(<TranslationPage />, document.getElementById('root'));

var x = function(){
   var ok = true;

   if (ok === true) {
      var div = document.createElement('div');

      div.id = "";
      document.getElementById('root').appendChild(div);
   }
   ReactDOM.render(<DataPage />, document.getElementById('#new'));
}

